import React from "react";
import styles from "./Main.module.scss";
import image1 from "./5.jpg";

const Main = () => {
  return (
    <div>
      <div className={styles.title}>
        <h2 className={styles.main_word}>Why</h2>
        <p className={styles.text}>do you need to plan a day?</p>
        <img src={image1} className={styles.main_1} alt="5" />
      </div>
      <ol className={styles.list}>
        <li className={styles.list_item}>Planning disciplines</li>
        <li className={styles.list_item}>Planning simplifies the workflow</li>
        <li className={styles.list_item}>Planning makes us more efficient</li>
        <li className={styles.list_item}>Planning reduces stress</li>
        <li className={styles.list_item}>Planning develops punctuality</li>
      </ol>
      <img/>
    </div>
  );
};

export default Main;
